import React, { Component } from 'react'
import psj from 'pubsub-js'
export default class Pubsub extends Component {
    say = () => {
        psj.subscribe("atguigu", (_, data) => {
            console.log("i say" + data);
        })
    }
    render() {
        return (
            <div>
                <button onClick={this.say}>hello</button>
            </div>
        )
    }
}
